def get_name(str,id):
    if id == 1:
        file = 'C:/Users/tiffa/Desktop/信息安全1班.xlsx'  # 含有名单的文件
    elif id ==2:
        file = 'C:/Users/tiffa/Desktop/信息安全2班.xlsx'  # 含有名单的文件
    data = pd.read_excel(file)  # 读取xlsx文件
    data1 = data['姓名']  # 读取名单文件，属性为姓名的列（读取名单）
    not_vote = []
    vote = []
    for i in data1:#获得名字
        if i in str:#如果名字在字符串内
            vote.append(i)
            print(i,"已投票")
        else:
            not_vote.append(i)
            print(i, "******************未投票")
    return vote,not_vote
